import { Output } from '../components/blocks/form';

const Bill = () => {
  let values = JSON.parse(localStorage.getItem('bill'));

  return (
    <section className='bill'>
      <form action='#'>
        {Object.entries(values).map(item => {
          return <Output name={item[0]} service={item[1]} />;
        })}
        inp
      </form>
    </section>
  );
};

export default Bill;
